-- Insertion des spectacles
INSERT INTO `spectacle` (`id_spectacle`, `titre`, `artiste`, `duree`, `style`, `video`, `description`, `id_img`, `statut`) VALUES
(1, 'Palalapapapapa', 'Les Fatals Picards', 120, 'Rock', 'https://www.youtube.com/embed/GbOOQDj9Byg', 'Les Fatals Picards est un groupe de comedy rock français, mêlant humour, second degré et engagement à travers divers styles, allant de la chanson française au ska, en passant par le rock. Ils se sont fait connaître du grand public en participant au Concours Eurovision de la chanson 2007 avec leur chanson L&#39;Amour à la française. Ils ont fini 22e1 sur 24 participants (ex aequo avec le groupe Scooch pour le Royaume-Uni), ce qui est une source de plaisanterie pendant leurs concerts. ', 2, 'confirmé'),
(2, 'Tout est trop beau', 'Maxence', 100, 'Pop', 'https://www.youtube.com/embed/MAvGx1hx-aQ', 'Maxence Lapérouse dit Maxence, né le 2 mars 1995 à Nîmes dans le Gard, est un auteur-compositeur-interprète et acteur français.&#13;&#10;&#13;&#10;Après deux EPs sortis avec son premier groupe Fysh entre 2013 et 2015, puis un en collaboration avec VSO en 2017, il publie en 2019 son premier EP solo, intitulé @, puis en 2021 son premier album, Tout est trop beau. En parallèle, il se fait connaître par des reprises et des chansons originales humoristiques publiées sur YouTube sous le nom Maxenss. Il est également acteur dans plusieurs productions à la télévision ou au cinéma. ', 4, 'confirmé'),
(3, 'Nonante-Cinq', 'Angèle', 120, 'Pop', 'https://www.youtube.com/embed/XqAiGeEzctQ', 'Angèle Joséphine Aimée Van Laeken, dite Angèle, née le 3 décembre 1995 à Uccle (Bruxelles-Capitale), est une auteure-compositrice-interprète, musicienne, productrice, actrice et mannequin belge d&#39;expression française.&#13;&#10;&#13;&#10;Son premier album, Brol, sorti en octobre 2018 et certifié double disque de diamant, se vend à plus de 500 000 exemplaires dans les onze premiers mois après sa sortie, atteignant ainsi la première place des ventes d&#39;albums en France pour l&#39;année 20191,2. En 2021 sort son album Nonante-cinq, qui connaît également le succès.&#13;&#10;&#13;&#10;En 2020, elle remporte la Victoire de la musique du concert de l&#39;année pour son Brol Tour. En 2022, elle est nommée l&#39;Artiste féminine francophone de l’année puis l&#39;année suivante, elle remporte le trophée de l’artiste féminine de l’année et de l’album le plus streamé de l’année3. Elle fait une apparition remarquée en interprétant, accompagnée du groupe Phoenix et de Kavinsky, le titre « Nightcall », lors de la cérémonie de clôture des Jeux olympiques de Paris 20244. Cette performance a engendré le record de la musique la plus shazamée de l’histoire en 1 minute sur l’application Shazam5. ', 7, 'confirmé'),
(4, 'Le Gros 4', 'Tagada Jones', 120, 'Rock', 'https://www.youtube.com/embed/1g8xLoH2dpw', 'Tagada Jones est un groupe de punk métal français, originaire de Rennes, en Bretagne. Le style musical du groupe est entre autres teinté de heavy métal et d&#39;électro. Il est actuellement composé de Niko au chant et guitare, Waner (Right 4 Life, Kickback, Nevrotic Explosion) à la basse, Stef à la guitare, Job (Right 4 Life, Tromatized Youth, Nevrotic Explosion) à la batterie et compte 1 800 concerts et 24 pays traversés. ', 9, 'confirmé');


